    internal InnerCampaignS3ConfigFactory S3ConfigFactory { get; set; }

    internal InnerCampaignMqttTopicConfigFactory MqttTopicConfigFactory { get; set; }

    internal InnerCampaignTimestreamConfigFactory TimestreamConfigFactory { get; set; }

    protected override Humidifier.IoTFleetWise.CampaignTypes.DataDestinationConfig Create()
    {
        var dataDestinationConfigResult = CreateDataDestinationConfig();
        factoryAction?.Invoke(dataDestinationConfigResult);

        return dataDestinationConfigResult;
    }

    private Humidifier.IoTFleetWise.CampaignTypes.DataDestinationConfig CreateDataDestinationConfig()
    {
        var dataDestinationConfigResult = new Humidifier.IoTFleetWise.CampaignTypes.DataDestinationConfig();

        return dataDestinationConfigResult;
    }
    public override void CreateChildren(Humidifier.IoTFleetWise.CampaignTypes.DataDestinationConfig result)
    {
        base.CreateChildren(result);

        result.S3Config ??= S3ConfigFactory?.Build();
        result.MqttTopicConfig ??= MqttTopicConfigFactory?.Build();
        result.TimestreamConfig ??= TimestreamConfigFactory?.Build();
    }

} // End Of Class

